import React from "react";
import {
    FilterOperator as FilterOperatorType,
    FilterProperty as FilterTypeType,
    SearchFilter as SearchFilterType
} from "../types/searchFilters.type";
import {FilterPropertySelect} from "./filterPropertySelect.component";
import {ChangeFilter, Trigger} from "../types/methods.type";
import {FilterValueInput} from "./filterValueInput.components";
import {DeleteFilter} from "./deleteFilter.component";
import {FilterOperator} from "./filterOperator.component";
import "../style/searchFilters.css"

export function SearchFilterComponent({searchFilter, changeFilter, deleteFilter}:{searchFilter:SearchFilterType, changeFilter:ChangeFilter, deleteFilter:Trigger}) {
    const {filterProperty,value,operator} = searchFilter;
    return <div>
        <FilterPropertySelect filterProperty={filterProperty} changeFilterType={(newType:FilterTypeType)=>changeFilter({filterProperty:newType,operator,value})}/>
        <FilterOperator filterProperty={filterProperty} operator={operator} changeOperator={(newOperator:FilterOperatorType)=>changeFilter({filterProperty, operator:newOperator,value})}/>
        <FilterValueInput filterProperty={filterProperty} filterValue={value} changeFilterValue={(newValue:string)=>changeFilter({filterProperty, operator,value:newValue})}/>
        <span className={!filterProperty?'blur':''}><DeleteFilter deleteFilter={deleteFilter}/></span>
    </div>;
}
